(function($){Drupal.behaviors.beautytips={attach:function(context,settings){jQuery.bt.options.closeWhenOthersOpen=true;beautytips=Drupal.settings.beautytips;for(var key in beautytips){var bt_options=new Array();if(beautytips[key]["list"]){for(var k=0;k<beautytips[key]["list"].length;k++){bt_options[beautytips[key]["list"][k]]=beautytips[key][beautytips[key]["list"][k]];}}if(beautytips[key]["cssSelect"]){if(beautytips[key]["contentSelector"]&&beautytips[key]["preEval"]){jQuery(beautytips[key]["cssSelect"]).each(function(){eval(beautytips[key]["contentSelector"]);});}if(beautytips[key]["text"]){jQuery(beautytips[key]["cssSelect"]).each(function(){jQuery(this).bt(beautytips[key]["text"],bt_options);});}else{if(beautytips[key]["ajaxPath"]){jQuery(beautytips[key]["cssSelect"]).each(function(){jQuery(this).bt(bt_options);if(beautytips[key]["ajaxDisableLink"]){jQuery(beautytips[key]["ajaxDisableLink"]).click(function(){return false;});}});}else{jQuery(beautytips[key]["cssSelect"]).each(function(){jQuery(this).bt(bt_options);});}}}bt_options.length=0;}}};})(jQuery);